        { ?uri <http://dbpedia.org/property/ground> ?ground . FILTER (regex(?ground, 'Spain')) }
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE
{ 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country>  .
        ?uri <http://dbpedia.org/ontology/officialLanguage> ?language .
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} 
GROUP BY ?uri ?string
HAVING (COUNT(?language) > 2)

SELECT DISTINCT ?uri ?string 
WHERE {       
        <http://dbpedia.org/resource/Annapurna> <http://dbpedia.org/ontology/elevation> ?elevation .
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> . 
        ?uri <http://dbpedia.org/ontology/elevation> ?otherelevation .
        FILTER (?otherelevation < ?elevation) .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') } 
} 
ORDER BY DESC(?otherelevation) LIMIT 1

SELECT DISTINCT ?uri ?string 
WHERE {
  ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Actor> .
  { ?uri <http://dbpedia.org/ontology/birthPlace> res:Germany . }
  UNION 
  { ?uri <http://dbpedia.org/ontology/birthPlace> ?place .
    ?place <http://dbpedia.org/ontology/country> res:Germany . }
  OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string 
WHERE {
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/City> .
        ?uri <http://dbpedia.org/ontology/isPartOf> <http://dbpedia.org/resource/New_Jersey> .
        ?uri <http://dbpedia.org/property/populationTotal> ?inhabitants .
        FILTER (?inhabitants > 100000) .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfGermany> .
        { ?uri <http://dbpedia.org/property/rulingParty> 'SPD'@en . } UNION { ?uri <http://dbpedia.org/property/rulingParty> <http://dbpedia.org/resource/Social_Democratic_Party_of_Germany> . } 
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE
{
	?x <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Album> .
	?x <http://dbpedia.org/ontology/artist> <http://dbpedia.org/resource/Elvis_Presley> .
	?x <http://dbpedia.org/ontology/releaseDate> ?y .
	?x <http://dbpedia.org/ontology/recordLabel> ?uri .
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
ORDER BY ASC(?y) LIMIT 1

SELECT DISTINCT ?uri ?string WHERE
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
	?uri <http://dbpedia.org/ontology/director> <http://dbpedia.org/resource/Sam_Raimi> .
	{ ?uri <http://dbpedia.org/ontology/releaseDate> ?x . } UNION { ?uri <http://dbpedia.org/property/released> ?x . }
	<http://dbpedia.org/resource/Army_of_Darkness> <http://dbpedia.org/ontology/releaseDate> ?y .
	FILTER (?x > ?y)
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> dbo:Song .
        ?uri dbo:artist res:Bruce_Springsteen .
        ?uri dbo:releaseDate ?date . 
        FILTER (?date >= '1980-01-01'^^xsd:date && ?date <=> '1990-12-31'^^xsd:date)
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Book> .
	?uri <http://dbpedia.org/ontology/author> <http://dbpedia.org/resource/William_Goldman> .
        ?uri <http://dbpedia.org/ontology/numberOfPages> ?x .
        FILTER (?x > 300)
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/DaughtersOfBritishEarls> .
	?uri <http://dbpedia.org/ontology/birthPlace> ?x .
	?uri <http://dbpedia.org/ontology/deathPlace> ?y .
	FILTER (?x != ?y) .
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?uri <http://dbpedia.org/property/shipNamesake> res:Benjamin_Franklin .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE
{
        { ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/ArgentineFilms> . }
        UNION
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
	{ ?uri <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Argentina> . } UNION { ?uri <http://dbpedia.org/property/country> 'Argentina'@en . } }
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE
{
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Lake> .
	  ?uri <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Denmark> . }
	UNION
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/LakesOfDenmark> . }
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
	<http://dbpedia.org/resource/Utah> <http://dbpedia.org/property/timezone> ?x . 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> . 
        ?uri <http://dbpedia.org/property/timezone> ?x .
        FILTER (?uri != <http://dbpedia.org/resource/Utah>)
	OPTIONAL> { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Weapon> .
	?uri <http://dbpedia.org/property/designer> ?x .
        <http://dbpedia.org/resource/Uzi> <http://dbpedia.org/property/designer> ?x .
        FILTER (?uri != <http://dbpedia.org/resource/Uzi>)
	OPTIONAL> { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{	
