        { ?uri <http://dbpedia.org/ontology/headquarter> <http://dbpedia.org/resource/Munich> . } 
        UNION 
        { ?uri <http://dbpedia.org/ontology/location>City> <http://dbpedia.org/resource/Munich> . }
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
	res:Skype <http://dbpedia.org/ontology/developer> ?uri .
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{       
        ?uri <http://dbpedia.org/ontology/type> <http://dbpedia.org/resource/Nonprofit_organization> .
        { ?uri <http://dbpedia.org/ontology/location>Country> <http://dbpedia.org/resource/Australia> . }
        UNION
        { ?uri <http://dbpedia.org/ontology/location> ?x . 
          ?x <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Australia> . }
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?x <http://dbpedia.org/ontology/director> <http://dbpedia.org/resource/William_Shatner> .
        ?x <http://dbpedia.org/ontology/starring> <http://dbpedia.org/resource/William_Shatner> .
        { ?x <http://dbpedia.org/ontology/starring> ?uri . } UNION { ?x <http://dbpedia.org/property/starring> ?uri . }
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string ?x WHERE 
{ 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
	?uri <http://dbpedia.org/property/admittancedate> ?x .
	OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }  
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri ?string WHERE 
{
        res:Canada dbo:capital ?uri .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Automobile> .   
        { ?uri <http://dbpedia.org/property/production> <http://dbpedia.org/resource/Germany> . } UNION { ?uri <http://dbpedia.org/property/assembly> <http://dbpedia.org/resource/Germany> . }
        UNION { ?uri <http://dbpedia.org/property/manufacturer> ?x .  
        { ?x <http://dbpedia.org/ontology/locationCountry> <http://dbpedia.org/resource/Germany> . } UNION { ?x <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/AutomotiveCompaniesOfGermany> . } }
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/River> .
        ?uri <http://dbpedia.org/property/length> ?x .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri ?string WHERE {
	?uri <http://dbpedia.org/ontology/team> ?x .
	?x <http://dbpedia.org/ontology/league> <http://dbpedia.org/resource/Premier_League> .
	?uri <http://dbpedia.org/ontology/birthDate> ?y .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
ORDER BY DESC(?y) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri ?string WHERE {
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/WorldHeritageSite> .
	?uri <http://dbpedia.org/property/year> ?x .
	FILTER ( ?x >= "2007"^^xsd:integer)
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/FormulaOneRacer> .
	?uri <http://dbpedia.org/ontology/races> ?x .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
ORDER BY DESC(?x) OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri ?string WHERE 
{
	?uri <http://dbpedia.org/ontology/occupation> <http://dbpedia.org/resource/Skateboarding> . 
        { ?uri <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/Sweden> . }
        UNION
        { ?uri <http://dbpedia.org/ontology/birthPlace> ?place . 
          ?place <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Sweden> . }
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> .
	?uri <http://dbpedia.org/ontology/elevation> ?elevation .
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
ORDER BY DESC(?elevation) OFFSET 1 LIMIT 1

SELECT DISTINCT ?uri ?string WHERE 
{
	{ ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/City> . } UNION { ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Town> . }
        ?uri <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Germany> .
	?uri <http://dbpedia.org/ontology/populationTotal> ?population .
	FILTER ( ?population > 250000 ) 
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}
